import React from 'react';

const Sidebar = () => {
  return (
    <aside className="sidebar">
      <ul>
        <li>Dashboard</li>
        <li>Metrics</li>
        <li>Logs</li>
        <li>Alerts</li>
      </ul>
    </aside>
  );
};

export default Sidebar;
